import React from "react";
import Navbar from "../../components/navbar/Navbar";

export default function Dashboard() {
  return (
    <>
      <Navbar />
      <div className="container-fluid " style={{ backgroundColor: "#f7f7fa" }}>
        <div className="container p-5 mx-auto text-center">
          <div className="row">
            <div className="col col-sm-6 col-md-6 col-lg-4">
              <div className="container-fluid bg-light border r" >
                <h6>Total Students</h6>
                <p>152</p>
              </div>
            </div>
            <div className="col col-sm-6 col-md-6 col-lg-4">Column</div>
            <div className="col col-sm-6 col-md-6 col-lg-4">Column</div>
          </div>
        </div>
      </div>
    </>
  );
}
